import React from 'react';
import { useState } from 'react';

import data from './levels.json'
import Tracks from './Tracks'
import ChronoTime from './ChronoTime';


function App() {

  const [lap, setLap] = useState(85123);

  return (
    <div>
      <h1>F1 2022 Difficulty Helper</h1>
      <h2>Your lap time</h2>
      <ChronoTime 
        value={lap} 
        onChange={(t) => setLap(t)} />
      <h2>Track</h2>
      <Tracks 
        data={data}
        time={lap} />

    </div>
  );
}

export default App;
